            <div className="cotw_cards">
                <Small_rest_card rest_img="https://static.vecteezy.com/packs/media/vectors/term-bg-1-3d6355ab.jpg" rest_name="afjad sadsa "/>        
                <Small_rest_card rest_img="https://static.vecteezy.com/packs/media/vectors/term-bg-1-3d6355ab.jpg" rest_name="afjad sadsa "/>        
